import React from "react";

const ContactForm = () => {
  return (
    <form className="max-w-[40em] mt-8">
        <div className="flex">

        <div className="flex flex-col">
        <label for="name" className="text-white ml-2 mb-1">First Name</label>
        <input type="text" className="bg-transparent border-2 border-[#515151] p-2 rounded-lg" placeholder="First name" />
      </div>
        </div>
      <div className="flex flex-col">
        <label for="name" className="text-white ml-2 mb-1">First Name</label>
        <input type="text" className="bg-transparent border-2 border-[#515151] p-2 rounded-lg" placeholder="First name" />
      </div>
    </form>
  );
};

export default ContactForm;
